import React from 'react';
import ReactDOM from "react-dom";
import { BrowserRouter as Router, Route, Link, Redirect } from 'react-router-dom';


import RegisterForm from './components/RegisterForm';
import LoginForm from './components/LoginForm';
import DonationForm from './components/DonationForm';
import DonationSecondForm from './components/DonationSecondForm';
import DonorPage from './components/DonorPage';
import BloodRequestForm from './components/BloodRequestForm';

import { createStore, applyMiddleware } from 'redux';
import { Provider } from 'react-redux';
import rootReducer from './reducers';
import thunk from 'redux-thunk';

import { Navbar, Nav, NavDropdown, Form, FormControl, Button } from 'react-bootstrap';

import * as bs from 'react-bootstrap';

import  '../src/style.css';

class App extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            isLogin : false,
            user : {},
            users : [],
            donationRequest : [],
        }
    }

    render() {
        return (
            <Router>
                <div className="App">
                    {/* <div className="header">
                        <div className="logo">
                            <span>logo</span>
                        </div>

                        <div className="header-menu-items">
                            <div className="menu-items">
                                <ul>
                                    <li><Link to="/">Home</Link></li>
                                    <li><Link to="/request_list">Request List</Link></li>
                                    <li><Link to="/donate">Donate</Link></li>
                                    <li><Link to="/request">Request</Link></li>                                    
                                </ul>
                            </div>

                            <div className="menu-items-right">
                                <ul>
                                    <li><Link to="/login">Login</Link></li>
                                    <li><Link to="/register">Register</Link></li>   
                                </ul>
                            </div>
                        </div>

                    </div> */}

                <Navbar bg="light" expand="lg">
                <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                    <Nav.Link href="#home">Home</Nav.Link>
                    <Nav.Link href="#link">Link</Nav.Link>
                    <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                        <NavDropdown.Divider />
                        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                    </NavDropdown>
                    </Nav>
                    <Form inline>
                    <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                    <Button variant="outline-success">Search</Button>
                    </Form>
                </Navbar.Collapse>
                </Navbar>
                </div>

                <h1>Welcome to Blood Sharing!</h1>
                <Link to="/">Home</Link> | <Link to="/register">Register</Link> | <Link to="/login">Login</Link> | <Link to="/donate">Donate</Link> | <Link to="/blood/request">Request</Link>

                <Route path="/register" render={ props => (<RegisterForm {...props} />)} />
                <Route path="/login" render={ props => (<LoginForm {...props} />)} />
                <Route exact path="/donate" render={ props => (<DonationForm {...props} />)} />
                <Route exact path   ="/donate/next" render={ props => (<DonationSecondForm {...props} />)} />
                <Route path="/blood/request" render={ props => (<BloodRequestForm {...props} />)} />
                <Route exact path="/donor" render={ props => (<DonorPage {...props} />)} />
            </Router>
        )
    }
}

const rootElement = document.getElementById("root");
const store = createStore(rootReducer,applyMiddleware(thunk))  ;
ReactDOM.render(
  <Provider store={store}>
    <App />
  </Provider>,
  rootElement
);
